/// An Efi guid representation
#[repr(C)]
#[derive(Debug, Copy, Clone, Eq, PartialEq)]
pub struct EfiGuid(u32, u16, u16, [u8; 8]);

macro_rules! impl_efi_guid {
    ($($(#[$inner:ident $($args:tt)*])* $const_name:ident => $field:ident => $value:expr,)*) => {

        /// Human readable enum of well-known EFI.
        /// These GUIDS are from:
        /// - <https://github.com/theopolis/uefi-firmware-parser/tree/master/uefi_firmware/guids>
        /// - <https://github.com/redox-os/uefi/blob/master/src/guid.rs>
        /// The ones from uefi-firmware-parser have a lot of duplicates and 
        /// general errors, so this is my best-effort attempt to make a complete
        /// list, but no guarantees.
        #[derive(Debug, Clone, Copy, PartialEq)]
        pub enum EfiGuidEnum {
            $(
                $(#[$inner $($args)*])*
                $field,
            )*
            /// An invalid value
            Unknown(EfiGuid),
        }

        // define the const values so we can use them in a match
        $(
            const $const_name: EfiGuid = $value;
        )*

        
        impl From<EfiGuid> for EfiGuidEnum {
            fn from(other: EfiGuid) -> EfiGuidEnum {
                match other {
                    // TODO!: we got some duplicate names, god this sucks
                    $(
                        #[allow(unreachable_patterns)]
                        $const_name => EfiGuidEnum::$field,
                    )*

                    x => EfiGuidEnum::Unknown(x)
                }
            }
        }

        impl From<EfiGuidEnum> for EfiGuid {
            fn from(other: EfiGuidEnum) -> EfiGuid {
                match other {
                    $(
                        EfiGuidEnum::$field => $const_name,
                    )*

                    EfiGuidEnum::Unknown(x) => x, 
                }
            }
        }

    };
}

